import CONST from "./CONST.js";
import logo from "../assets/imagenes/logo.svg";

function Header() {
	return (
		<header>
			<img src={logo} alt={nombre} />
			<p>AAA ({nombre}) BBBB</p>
			<p>HOLA</p>
		</header>
	)
}
export default Header;
